import React, { useState, useEffect } from 'react';

import PatientNavBar from '../Components/PatientNavBar'
function Hospitals() {
    const [hospital, setHospital] = useState([
        {
            hospitalId: 1,
            hospitalName: "Krishna",
            hospitalAddress: "KUniamuthur"
        },
        {
            hospitalId: 2,
            hospitalName: "Kumaraguru",
            hospitalAddress: "Saravanampatti"
        },
        {
            hospitalId: 3,
            hospitalName: "KMCH",
            hospitalAddress: "Neelambur"
        },
    ])
    return (
        <>
            <PatientNavBar />
            <div>
                {
                    hospital.map((hos)=>{hos.hospitalName})
                }
            </div>
        </>
    )
}

export default Hospitals
